import React from 'react';
import logo from './pages/images/logo.png';
import { Layout, Menu } from 'antd';

const { Header } = Layout;

function NavTabs({ currentPage, handlePageChange }) {
  return (
    <Header
      style={{
        position: 'sticky',
        top: 0,
        zIndex: 1,
        width: '100%',
        display: 'flex',
        alignItems: 'center',
      }}
    >
      <div className="logo">
        <img src={logo} alt="Travel Bug Logo" style={{ width: '200px', height: '50px' }} />
      </div>
      <Menu
        theme="lgiht"
        mode="horizontal"
        defaultSelectedKeys={['Home']}
        selectedKeys={[currentPage]}
        onClick={({ key }) => handlePageChange(key)}
      >
        <Menu.Item key="Home">Home</Menu.Item>
        <Menu.Item key="Attractions">Attractions</Menu.Item>
        <Menu.Item key="PlacesToGo">Places to Visit</Menu.Item>
        <Menu.Item key="Restaurants">Restaurants</Menu.Item>
      </Menu>
    </Header>
  );
}

export default NavTabs;
